import { React } from "react";
import {
  Home,
  Favorite,
  Whatshot,
  TrendingUp,
  FiberNew,
  Update,
} from "@material-ui/icons";
import "../styles.css";

const DrawerExpanded = (props) => {
  const {
    handleHomeClick,
    handlePopularClick,
    handleTrendingClick,
    handleLatestClick,
    handleUpcomingClick,
    handleFavouritesClick,
  } = props;

  return (
    <>
      <div class="drawer-menu-item">
        <Home class="drawer-menu-icon" onClick={handleHomeClick} />
        <text class="drawer-menu-label">Home</text>
      </div>
      <div class="drawer-menu-item">
        <Whatshot class="drawer-menu-icon" onClick={handlePopularClick} />
        <text class="drawer-menu-label">Popular</text>
      </div>
      <div class="drawer-menu-item">
        <TrendingUp class="drawer-menu-icon" onClick={handleTrendingClick} />
        <text class="drawer-menu-label">Trending</text>
      </div>
      <div class="drawer-menu-item">
        <FiberNew class="drawer-menu-icon" onClick={handleLatestClick} />
        <text class="drawer-menu-label">New</text>
      </div>
      <div class="drawer-menu-item">
        <Update class="drawer-menu-icon" onClick={handleUpcomingClick} />
        <text class="drawer-menu-label">Upcoming</text>
      </div>
      <div class="drawer-menu-item">
        <Favorite class="drawer-menu-icon" onClick={handleFavouritesClick} />
        <text class="drawer-menu-label">Top Rated</text>
      </div>
    </>
  );
};

export default DrawerExpanded;
